import styled from 'styled-components/macro';

export const StoriesSection = styled.div`
  min-height: 600px;
  padding: 50px 9%;
  background: rgb(237, 248, 245);
  position: relative;
`;

export const ButtonBlock = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
`;

export const TitleStories = styled.div`
  font-weight: bold;
  line-height: 1.17;
  font-size: 46px;
  text-align: center;
`;
